import json
import re

import json

def extract_resume_data(input_json, programming_keywords, professional_keywords):
    # Load the JSON data if it's a string or assume it's already a dictionary
    if isinstance(input_json, str):
        data = json.loads(input_json)
    else:
        data = input_json

    # Initialize output dictionary
    output = {
        "Name": "",
        "Lastname": "",
        "Firstname": "",
        "Phone": "",
        "Current city": "",
        "Current state": "",
        "Earliest degree": "",
        "Earliest degree year": "",
        "Earliest degree field": "",
        "Earliest degree institution": "",
        "Second degree": "",
        "Second degree year": "",
        "Second degree field": "",
        "Second degree institution": "",
        "Third degree": "",
        "Third degree year": "",
        "Third degree field": "",
        "Third degree institution": "",
        "Other degrees": "n",
        "Most recent job title": "",
        "Most recent job company": "",
        "Most recent job years": "",
        "Previous job title": "",
        "Previous job company": "",
        "Previous job years": "",
        "Next previous job title": "",
        "Next previous job company": "",
        "Next previous job years": "",
        "2nd next previous job title": "",
        "2nd next previous job company": "",
        "2nd next previous job years": "",
        "Python programming experience": "n",
        "C programming language experience": "n",
        "C++ programming experience": "n",
        "Swift programming experience": "n",
        "R programming experience": "n",
        "Neuroscience professional experience": "n",
        "Imaging data professional experience": "n",
        "Bioinformatics professional experience": "n"
    }

    # Extract basic fields
    try:
        resume = data['Value']['ResumeData']['ContactInformation']
        candidate_name = resume.get('CandidateName', {})
        formatted_name = f"{candidate_name.get('FamilyName', '')}-{candidate_name.get('GivenName', '')}-{candidate_name.get('MiddleName', '')}"
        output['Name'] = formatted_name.replace("--", "-").strip("-")
        output['Lastname'] = candidate_name.get('FamilyName', '')
        output['Firstname'] = candidate_name.get('GivenName', '')
        output['Phone'] = resume['Telephones'][0]['Normalized'] if resume.get('Telephones') else ""
        location = resume.get('Location', {})
        output['Current city'] = location.get('Municipality', '')
        output['Current state'] = ', '.join(location.get('Regions', []))
    except KeyError as e:
        print(f"Missing field in ContactInformation: {e}")
    except Exception as e:
        print(f"Error processing ContactInformation: {e}")

    # Extract education details
    try:
        education = sorted(data['Value']['ResumeData']['Education']['EducationDetails'], key=lambda x: x['LastEducationDate']['Date'])
        if education:
            output['Earliest degree'] = education[0]['Text']
            output['Earliest degree year'] = education[0]['LastEducationDate']['Date'][:4]
            output['Earliest degree field'] = ', '.join(education[0].get('Majors', []))
            output['Earliest degree institution'] = education[0]['SchoolName']['Normalized']
        if len(education) > 1:
            output['Second degree'] = education[1]['Text']
            output['Second degree year'] = education[1]['LastEducationDate']['Date'][:4]
            output['Second degree field'] = ', '.join(education[1].get('Majors', []))
            output['Second degree institution'] = education[1]['SchoolName']['Normalized']
        if len(education) > 2:
            output['Third degree'] = education[2]['Text']
            output['Third degree year'] = education[2]['LastEducationDate']['Date'][:4]
            output['Third degree field'] = ', '.join(education[2].get('Majors', []))
            output['Third degree institution'] = education[2]['SchoolName']['Normalized']
        output['Other degrees'] = 'y' if len(education) > 3 else 'n'
    except KeyError as e:
        print(f"Missing field in EducationDetails: {e}")
    except Exception as e:
        print(f"Error processing EducationDetails: {e}")

    # Extract job history
    try:
        jobs = sorted(data['Value']['ResumeData']['EmploymentHistory']['Positions'], key=lambda x: x['StartDate']['Date'], reverse=True)
        if jobs:
            output['Most recent job title'] = jobs[0]['JobTitle']['Normalized']
            output['Most recent job company'] = jobs[0]['Employer']['Name']['Normalized']
            output['Most recent job years'] = str(int(jobs[0]['EndDate']['Date'][:4]) - int(jobs[0]['StartDate']['Date'][:4]))
        if len(jobs) > 1:
            output['Previous job title'] = jobs[1]['JobTitle']['Normalized']
            output['Previous job company'] = jobs[1]['Employer']['Name']['Normalized']
            output['Previous job years'] = str(int(jobs[1]['EndDate']['Date'][:4]) - int(jobs[1]['StartDate']['Date'][:4]))
        if len(jobs) > 2:
            output['Next previous job title'] = jobs[2]['JobTitle']['Normalized']
            output['Next previous job company'] = jobs[2]['Employer']['Name']['Normalized']
            output['Next previous job years'] = str(int(jobs[2]['EndDate']['Date'][:4]) - int(jobs[2]['StartDate']['Date'][:4]))
        if len(jobs) > 3:
            output['2nd next previous job title'] = jobs[3]['JobTitle']['Normalized']
            output['2nd next previous job company'] = jobs[3]['Employer']['Name']['Normalized']
            output['2nd next previous job years'] = str(int(jobs[3]['EndDate']['Date'][:4]) - int(jobs[3]['StartDate']['Date'][:4]))
    except KeyError as e:
        print(f"Missing field in EmploymentHistory: {e}")
    except Exception as e:
        print(f"Error processing EmploymentHistory: {e}")

    # Concatenate all text to search for keywords
    try:
        all_text = str(input_json).lower()
        # all_text = data['Value']['ResumeData']['ProfessionalSummary'] + ' '.join([job['Description'] for job in data['Value']['ResumeData']['EmploymentHistory']['Positions']])
        # all_text = all_text.lower()  # Convert text to lowercase for case-insensitive search
    except KeyError as e:
        print(f"Missing field in ResumeData for text extraction: {e}")
        all_text = ""
    except Exception as e:
        print(f"Error processing text extraction: {e}")
        all_text = ""

    # Check for programming languages
    for lang in programming_keywords:
        output[f"{lang} programming experience"] = 'y' if lang.lower() in all_text else 'n'

    # Check for professional fields
    for field in professional_keywords:
        output[f"{field} professional experience"] = 'y' if field.lower() in all_text else 'n'

    return output

